import Link from 'next/link';
import { Button } from 'antd';
import Container from './_app';

const Index: React.FC = (props) => {

    console.log('component Index reander..');

    return (
        <Container Component={getPage} pageProps={{}} />
    )
}

const getPage = () => {
    return (
        <Link href='/home' title='homepage'>
            <Button>你好</Button>
        </Link>
    )
}



export default Index;
